  Portland: 50,
  Seattle: 80,
  "New York": 20,
  Bogota: 20,
  Cali: 40,
  Paris: 2,
};
for (const [key, val] of Object.entries(values)) {
  client.hset(name, key, val, (_, reply) => redis.print(`Reply: ${reply}`));
}
client.hgetall(name, (_, object) => console.log(object));

