  }
];

import kue from 'kue';
const push_notification_code_2 = kue.createQueue({
  redis: {
    host: 'localhost',
    port: '6379'
  }
});

jobs.forEach((jobData) => {
  const job = push_notification_code_2.create('push_notification_code_2', jobData).save((err) => {
    if (err) {
      console.log(`Notification job JOB_ID failed:`, err)
    } else {
      console.log('Notification job created:', job.id)
    }
  });

  job.on('complete', () => {
    console.log('Notification job', job.id, 'completed');
  });

  job.on('failed', (err) => {
    console.log('Notification job', job.id, 'failed:', err);
  });

  job.on('progress', (progress, data) => {
    console.log('Notification job', job.id, Math.floor(progress) + '% completed')
  });
});
